import MSFTAutoSuggestOption from "./auto-suggest-option";
import autoSuggestOptionSchema from "./auto-suggest-option.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { AutoSuggestOptionStyles, } from "@microsoft/fast-components-styles-msft";
/* tslint:disable-next-line:typedef */
const AutoSuggestOption = manageJss(AutoSuggestOptionStyles)(MSFTAutoSuggestOption);
export { AutoSuggestOption, autoSuggestOptionSchema, };
